export const deliveryMethods = {
  DELIVERY_ONLY: 'Delivery Only',
  PICKUP_ONLY: 'Pickup Only',
  PICKUP_AND_DELIVERY: 'Pickup&Delivery',
};

export const METHODS_WITH_DELIVERY_ARR = [
  deliveryMethods.PICKUP_AND_DELIVERY,
  deliveryMethods.DELIVERY_ONLY,
];

export const PICKUP_METHOD = 'pickup';
export const DELIVERY_METHOD = 'delivery';
